import styled from "@emotion/styled";
import { FormGroup } from "@mui/material";

export const StyledForm = styled.form`
    display: flex;
    flex-flow: column nowrap;
    justify-content: center;
    align-items: center;

    > input {
        text-align: center;
    }
`;
